import './css/home.css';
import Selector from './CircleWhite.png';
import CurrentSelector from './CircleRed.png';

const selector = <img src={Selector}/>;

function Home(){
    return(
        <main>
            <div>
                <h2><p>Название модели</p></h2>
                <div className='recommended'>
                    <div className='screen'>
                        <p className='rate'>5</p>
                        <p className='price'>199грн</p>
                    </div>
                    <div className='description'>

                    </div>
                </div>
                <div className='switcher'>{selector}</div>
            </div>
        </main>
    );
}

export default Home;
